1.compile with cdh5.9.0

2.custom the groupSearchFilter property in kylin.property
    ${ldap.user.groupSearchFilter}
    ${ldap.service.groupSearchFilter}
Overload AuthoritiesPopulator constructor to accept the groupSearchFilter, inject it with kylinSecurity.xml

a user can custom the groupSearchFilter in DefaultLdapAuthoritiesPopulator instead the default groupSearchFilter = "(member={0})";
